(1, 'CLAUSULA_001', 'Accesorios no registrados', 'La empresa no responde por ningún accesorio no registrado o no declarado en esta orden.', 'general', 1, b'1', '2025-08-05 05:18:14', '2025-08-05 05:40:13'),
(2, 'CLAUSULA_002', 'Fuerza mayor', 'En caso de fuerza mayor o en caso fortuito, la empresa no responde por pérdida o deterioro de los equipos dejados para su REPARACIÓN.', 'general', 2, b'1', '2025-08-05 05:18:14', '2025-08-05 05:18:14'),
(3, 'CLAUSULA_003', 'Derecho de retención', 'La empresa está en facultad para ejercer el derecho de RETENCIÓN del equipo mientras esté pendiente la cancelación de la cuenta.', 'pago', 3, b'1', '2025-08-05 05:18:14', '2025-08-05 05:18:14'),
(4, 'CLAUSULA_004', 'Tiempo de reclamación', 'Pasados los (30) días de no ser reclamado el equipo, la empresa no se hace responsable de este.', 'entrega', 4, b'1', '2025-08-05 05:18:14', '2025-08-05 05:18:14'),
(5, 'CLAUSULA_005', 'Garantía', 'Para hacer efectiva la garantía, el sello debe estar intacto.', 'garantia', 5, b'1', '2025-08-05 05:18:14', '2025-08-05 05:18:14'),
(6, 'CLAUSULA_006', 'Autorización', 'Es entendido que quien ordena y contrata el trabajo es el propietario del equipo o está autorizado por el dueño del mismo, quien conoce estas condiciones que son parte integrante del contrato que se celebra y que consta en este documento.', 'general', 6, b'1', '2025-08-05 05:18:14', '2025-08-05 05:18:14');
